"    Note the conjuncitivits. Subepithelial fibrosis, with a white \"feltwork\" of new collagen deposited under the conjunctival epithelium also is evident.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
